import React from "react";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import MenuItem from "@mui/material/MenuItem";

const category = [
  { value: 0, label: "Dynamic" },
  { value: 1, label: "Tree" },
];

const level = [
  { value: 0, label: "Easy" },
  { value: 1, label: "Medium" },
  { value: 2, label: "Hard" },
];

function ModalAddQuestion() {
  return (
    <Box
      component="form"
      sx={{
        "& .MuiTextField-root": { m: 1 },
        "& .MuiInputBase-root": {
          color: "white",
        },
        "& .MuiInputLabel-root": {
          color: "white",
        },
        "& .MuiOutlinedInput-root": {
          "& fieldset": {
            borderColor: "white",
          },
          "&:hover fieldset": {
            borderColor: "white",
          },
          "&.Mui-focused fieldset": {
            borderColor: "white",
          },
        },
        backgroundColor: "#1e1e1e",
        borderRadius: "20px",
        p: 3,
      }}
      noValidate
      autoComplete="off"
    >
      <div className="flex flex-col space-y-4">
        {/* Row 1 */}
        <div className="flex flex-row space-x-4">
          <TextField
            id="outlined-number"
            label="Number"
            type="number"
            InputLabelProps={{
              shrink: true,
            }}
            sx={{ width: "30%" }}
          />
          <TextField
            id="outlined-basic"
            label="Sub-Heading"
            variant="outlined"
            sx={{ width: "100%" }}
          />
        </div>

        {/* Row 2 */}
        <div className="flex flex-row space-x-4">
          <TextField
            id="category"
            select
            label="Category"
            sx={{ width: "100%" }}
          >
            {category.map((option) => (
              <MenuItem key={option.value} value={option.value}>
                {option.label}
              </MenuItem>
            ))}
          </TextField>
          <TextField id="level" select label="Level" sx={{ width: "100%" }}>
            {level.map((option) => (
              <MenuItem key={option.value} value={option.value}>
                {option.label}
              </MenuItem>
            ))}
          </TextField>
        </div>

        {/*  */}
        <div className="flex flex-row space-x-4">
          <TextField
            id="questionDescription"
            label="Question Description"
            multiline
            rows={4}
            sx={{width : "100%"}}
          />
        </div>

        <div className="flex flex-row space-x-4">
          <TextField
            id="questionDescription"
            label="Question Description"
            multiline
            rows={4}
            sx={{width : "100%"}}
          />
        </div>
      </div>
    </Box>
  );
}

export default ModalAddQuestion;
